    predict(inputs) {
        // Start at root node
        let node_id = 0;
        
        while (this.tree.children_left[node_id] != this.tree.children_right[node_id]) {
            let feature_idx = this.tree.feature[node_id];
            let feature_name = this.featureNames[feature_idx];
            let threshold = this.tree.threshold[node_id];
            
            if (inputs[feature_name] <= threshold) {
                node_id = this.tree.children_left[node_id];
            } else {
                node_id = this.tree.children_right[node_id];
            }
        }
        
        // Get probabilities from leaf node
        let leaf_values = this.tree.value[node_id][0];
        let total = leaf_values.reduce((a, b) => a + b, 0);
        let probabilities = leaf_values.map(v => v / total);
        
        // Find predicted class
        let predicted_class_idx = probabilities.indexOf(Math.max(...probabilities));
        let predicted_class = this.targetClasses[predicted_class_idx];
        
        return {
            riskLevel: predicted_class.toLowerCase(),
            confidence: Math.max(...probabilities),
            probabilities: {
                low: probabilities[0],
                moderate: probabilities[1],
                high: probabilities[2]
            }
        };
    }
    
    // Simplified prediction based on PM2.5 (for backup)
    simplePredict(inputs) {
        const pm25 = inputs['PM2.5'] || inputs['pm25'];
        
        if (pm25 <= 12) {
            return {
                riskLevel: 'low',
                confidence: 0.95,
                probabilities: { low: 0.85, moderate: 0.12, high: 0.03 }
            };
        } else if (pm25 <= 35) {
            return {
                riskLevel: 'moderate',
                confidence: 0.85,
                probabilities: { low: 0.20, moderate: 0.65, high: 0.15 }
            };
        } else {
            return {
                riskLevel: 'high',
                confidence: 0.90,
                probabilities: { low: 0.05, moderate: 0.20, high: 0.75 }
            };
        }
    }
